import React from 'react'
import './Header.css'
import MenuIcon from '@material-ui/icons/Menu';
import logo from "./imdb.png"

function Header() {
    return (

        <div className="header">
            <MenuIcon className="hamburger" />
            <img
          className="header__logo"
          src={logo}
          alt="Amazon"
        />
        </div>
    )
}

export default Header
